const items = $input.all();

function extractTextSafe(root) {
  const stack = [root];
  const seen = new WeakSet();

  while (stack.length) {
    const cur = stack.pop();

    if (!cur) continue;

    // If it's an array, push its children
    if (Array.isArray(cur)) {
      for (let i = 0; i < cur.length; i++) stack.push(cur[i]);
      continue;
    }

    // Only objects beyond this point
    if (typeof cur !== "object") continue;

    // Prevent circular loops
    if (seen.has(cur)) continue;
    seen.add(cur);

    // Direct match: OpenAI style content[0].text
    if (cur?.content?.[0]?.text && typeof cur.content[0].text === "string") {
      return cur.content[0].text;
    }

    // Also common: output_text blocks
    if (cur?.type === "output_text" && typeof cur.text === "string") {
      return cur.text;
    }

    // Push all object values for searching
    for (const v of Object.values(cur)) {
      if (v && (typeof v === "object")) stack.push(v);
    }
  }

  return null;
}

function parseJsonFromText(text) {
  let s = String(text).trim();

  // Remove code fences if any
  s = s.replace(/^\s*```(?:json)?\s*/i, "").replace(/\s*```\s*$/i, "").trim();

  // First parse attempt
  let data;
  try {
    data = JSON.parse(s);
  } catch (e) {
    // If there's extra junk around JSON, slice braces
    const start = s.indexOf("{");
    const end = s.lastIndexOf("}");
    if (start === -1 || end === -1 || end <= start) {
      throw new Error("Could not locate JSON object braces in the text.");
    }
    s = s.slice(start, end + 1);
    data = JSON.parse(s);
  }

  // If model returned JSON as a STRING (like "{\"a\":1}") then parse again
  if (typeof data === "string") {
    data = JSON.parse(data);
  }

  return data;
}

return items.map((item) => {
  const text = extractTextSafe(item.json);

  if (!text) {
    throw new Error("Could not find output text in item.json.");
  }

  const data = parseJsonFromText(text);

  return { json: data };
});

