  let s = String(text).trim();

  // Remove code fences if any
  s = s.replace(/^\s*```(?:json)?\s*/i, "").replace(/\s*```\s*$/i, "").trim();

  // First parse attempt
  let data;
  try {
    data = JSON.parse(s);
  } catch (e) {
    // If there's extra junk around JSON, slice braces
    const start = s.indexOf("{");
    const end = s.lastIndexOf("}");
    if (start === -1 || end === -1 || end <= start) {
      throw new Error("Could not locate JSON object braces in the text.");
    }
    s = s.slice(start, end + 1);
    data = JSON.parse(s);
  }

  // If model returned JSON as a STRING (like "{\"a\":1}") then parse again
  if (typeof data === "string") {
    data = JSON.parse(data);
  }

  return data;
}

return items.map((item) => {
  const text = extractTextSafe(item.json);

  if (!text) {
    throw new Error("Could not find output text in item.json.");
  }

  const data = parseJsonFromText(text);

  return { json: data };
});
